  \"2015-10-15T06:42:11.228218\",\n\t\"name\": \"rsbs-hvac-new-york-state-residential-statewide-baseline-study-heating-ventilation-and-air-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The New York State Energy Research and
  Development Authority (NYSERDA), in collaboration with the New York State Department
  of Public Service (DPS), conducted a statewide residential baseline study (study)
  from 2011 to 2014 of the single-family and multifamily residential housing segments,
  including new construction, and a broad range of energy uses and efficiency measures.
  This dataset includes data from 47 completed Heating Ventilation and Air Conditioning
  (HVAC) contractor surveys. The survey sample was stratified by the size of the HVAC
  contractor company: 28 survey completes for small companies (defined as having 1-10
  employees) and 19 survey completes for large companies (defined as larger than 10
  employees.) The surveys focused on employer or company information, sales of energy
  efficient HVAC equipment, installation practices, training, and experience with
  NYS energy efficiency programs.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
